import "./Infobar.css";

const Infobar = (props) => {

    return (
        <div className="infobar">
            <div className="infoName">
                {props.status === "profile" ? (
                    <label>profile</label>
                ) : (
                   <label>nothing</label>
                )}
            </div>
        </div>
    );
}

export default Infobar;
